import React, { useState } from 'react';
import { View, TouchableOpacity, StyleSheet, Text } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import HomeScreen from '../views/homeScreen';
import IngredientesScreen from '../views/IngredientScreen'; // Importa el componente IngredientesScreen
import TortasScreen from '../views/TortasScreen'; // Importa el componente TortasScreen

const AppNavigator = () => {
  const [isExpanded, setExpanded] = useState(false);
  const sidebarWidth = isExpanded ? 250 : 60;
  const arrowIcon = isExpanded ? 'chevron-left' : 'chevron-right';

  const toggleMenu = () => {
    setExpanded(!isExpanded);
  };

  const handleDashboardClick = () => {
    // Navegar a la pantalla de inicio (HomeScreen)
  };

  const handleIngredientesClick = () => {
    // Navegar a la pantalla de ingredientes (IngredientesScreen)
  };

  const handleTortasClick = () => {
    // Navegar a la pantalla de tortas (TortasScreen)
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity
        style={[styles.sidebar, { width: sidebarWidth }]}
        onPress={toggleMenu}
        activeOpacity={0.7}
      >
        <View style={styles.expandButton}>
          <Ionicons
            name={arrowIcon}
            size={24}
            color="white"
            style={styles.expandIcon}
          />
        </View>
        <Text style={[styles.logo, isExpanded ? {} : styles.hiddenText]}>@CostoSmart</Text>

        {isExpanded && (
          <View style={styles.menuItems}>
            <TouchableOpacity onPress={handleDashboardClick}>
              <Text style={styles.menuItem}>Dashboard</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={handleIngredientesClick}>
              <Text style={styles.menuItem}>Ingredientes</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={handleTortasClick}>
              <Text style={styles.menuItem}>Tortas</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => console.log('Recetas clicked')}>
              <Text style={styles.menuItem}>Recetas</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => console.log('Cuenta clicked')}>
              <Text style={styles.menuItem}>Cuenta</Text>
            </TouchableOpacity>
          </View>
        )}
        <View style={[styles.separator, isExpanded ? null : styles.hiddenSeparator]} />
        {isExpanded && (
          <View style={styles.bottomMenu}>
            <TouchableOpacity onPress={() => console.log('Settings clicked')}>
              <Text style={styles.bottomMenuItem}>Settings</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => console.log('Ayuda clicked')}>
              <Text style={styles.bottomMenuItem}>Ayuda</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => console.log('Contactanos clicked')}>
              <Text style={styles.bottomMenuItem}>Contactanos</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => console.log('Cerrar Sesion clicked')}>
              <Text style={styles.bottomMenuItem}>Cerrar Sesión</Text>
            </TouchableOpacity>
          </View>
        )}
      </TouchableOpacity>
      <View style={styles.content}>
        {/* Cambia el texto "Home" por los componentes correspondientes */}
        {isExpanded ? (
          <HomeScreen />
        ) : (
          <>
            <IngredientesScreen />
            <TortasScreen />
          </>
        )}
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: 'row',
  },
  sidebar: {
    backgroundColor: '#333',
    paddingTop: 40,
    alignItems: 'center',
    justifyContent: 'flex-start',
    zIndex: 1,
  },
  logo: {
    fontSize: 20,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 20,
  },
  hiddenText: {
    opacity: 0,
  },
  menuItems: {
    marginTop: 20,
  },
  menuItem: {
    fontSize: 16,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 10,
  },
  separator: {
    height: 1,
    backgroundColor: 'white',
    marginVertical: 20,
    width: '80%',
  },
  hiddenSeparator: {
    opacity: 0,
  },
  bottomMenu: {
    paddingBottom: 20,
  },
  bottomMenuItem: {
    fontSize: 16,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 10,
  },
  content: {
    flex: 1,
    backgroundColor: '#fff',
    justifyContent: 'center',
    alignItems: 'stretch',
  },
  expandButton: {
    width: 36,
    height: 36,
    backgroundColor: '#fff',
    borderRadius: 18,
    alignItems: 'center',
    justifyContent: 'center',
    marginBottom: 20,
  },
  expandIcon: {
    fontSize: 20,
  },
});

export default AppNavigator;
